import React, {Fragment} from "react";
import "Pontacion.css"

class Pontacion extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            null: null
        }
    }

    render() {
        return (
            <div>
                <img src="images/logo.svg" alt="logo" />
                <span id="pontos">
                    12
                </span>
            </div>
        )
    }
}

export default Pontacion
